column13:
A signal switch for sharing one or more console devices and one or more peripheral devices in any of a plurality of computer systems, comprising: 
a first channel for connecting a selected console device from the one or more console devices to a first selected computet system from the plurality of computer systems; 
a second channel connecting the first selected computer system to a selected peripheral device from the one or more peripheral devices, the second channel having a data flow between the first selected computer system and the selected peripheral device; 
a third channel for connecting the selected console device to a second selected computer system from the plurality of computet systems; and 
means for switching the selected console device between the first channel and the third channel without interruption of the data flow through the second channel between the first selected computer system and the selected peripheral device.

A signal switch for sharing one or more console devices and one or more peripheral devices in any of a plurality of computer systems, comprising: 
a first channel for connecting a selected console device from the one or more console devices to a first selected computet system from the plurality of computer systems; 
a second channel connecting the first selected computer system to a selected peripheral device from the one or more peripheral devices, the second channel having a data flow between the first selected computer system and the selected peripheral device; 
a third channel for connecting the selected console device to a second selected computer system from the plurality of computet systems; and 
means for switching the selected console device between the first channel and the third channel without interruption of the data flow through the second channel between the first selected computer system and the selected peripheral device.

This invention provides a method of storing encoded data on an article comprising applying said data on a surface of the article, as an encodement invisible to the human eye under normal viewing conditions. The invention also provides materials for use in said method. 

This invention comprises an article having on a surface thereof data represented by a material applied to the article that forms a differential light pattern when illuminated which is capable of being read by a sensor capable of detecting said differential light pattern, said material being substantially invisible to the human eye under normal viewing conditions; 

wherein the light absorbance of at least a portion of the surface of the article underlying said data is different from the absorbance of the material comprising the data under the conditions in which the data is read.
